PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "games" ("id" INTEGER NOT NULL PRIMARY KEY, "away_team_name" TEXT, "home_team_name" TEXT, "away_team" INTEGER, "home_team" INTEGER, "away_pts" INTEGER, "home_pts" INTEGER, "away_pitcher_id" INTEGER, "home_pitcher_id" INTEGER, "scheduled_date" DATETIME, mlbgame_away_team_name text, mlbgame_home_team_name text, mlbgame_id_str text not null unique);
CREATE TABLE IF NOT EXISTS "SRS_ratings" ("id" INTEGER NOT NULL PRIMARY KEY, "rating_date" DATETIME, "team_id" INTEGER, "rating" REAL);
CREATE TABLE IF NOT EXISTS "teams" (
	`id`	INTEGER NOT NULL,
	`abbreviation`	TEXT,
	`city`	TEXT,
	`league`	TEXT,
	`division`	TEXT,
	`team_id`	INTEGER,
	`team_name`	TEXT,
	`stadium_type`	TEXT,
	`mlbgames_name`	TEXT,
	PRIMARY KEY(id)
);
COMMIT;
